drop table USUARIOS;
drop sequence USUARIOS_ID;

CREATE TABLE USUARIOS (    
  ID                 NUMBER             NOT NULL PRIMARY KEY,  
  MATRICULA          VARCHAR(30 BYTE)   DEFAULT 0,
  NOME               VARCHAR(70 BYTE)   NULL,
  SENHA              VARCHAR(70 BYTE)   NULL, 
  NIVEL              NUMBER             NULL,
  MALETA             NUMBER             DEFAULT 0, 
  EMAIL              VARCHAR(70 BYTE)   NULL,
  ACESSOS            NUMBER             NULL,
  DATACRIACAO        DATE               NULL,
  DATAALTERACAO      DATE               NULL,
  ATIVO_SN           VARCHAR2(1 BYTE)   NOT NULL);  
 
CREATE SEQUENCE USUARIOS_ID
  START WITH 1
  MAXVALUE 999999999999999999999999999
  MINVALUE 1
  NOCYCLE
  CACHE 20
  NOORDER;
  
CREATE TRIGGER TRG_USUARIOS BEFORE INSERT ON USUARIOS FOR EACH ROW
BEGIN
    IF :NEW.MATRICULA IS NULL THEN
       :NEW.MATRICULA := '0';
    END IF;
    IF :NEW.MALETA IS NULL THEN
       :NEW.MALETA := 0;
    END IF;
  END;
  /
  

SELECT * FROM USUARIOS;